Sex and the Swastika

War Documentary hosted by Nigel Anthony, published by Channel 4 broadcasted as part of Ch4 Secret History series in 1999 - English narration


Information
------------------------------

The private lives of the Nazis is a tale of sordid self-fulfilment at total odds with official policy and the theory of a pure master race. Hitler, Himmler, Goebbels and many others indulged themselves whilst creating The Advisory Board for Population and Racial Policy to oversee the morals of the German population. However, Britain's secret Special Operations Executive knew the truth and set up a special division to elaborate on it. Working from a secret location in the English countryside they created 'Black' propaganda and disseminated pornography to German troops and the German population illustrating the sexual perversions of their leaders. This is the tale of how the Nazis fiddled while Germany burned.

